車屋さんやバイク修理屋さんの必須アイテムです！！
<br>エアーツールとコンプレッサーの間接工具、
<br>とっても便利な自動巻上げエアーホールリール8mです。

<br><br>天吊フックで天井やパイプに、付属のブラケットで壁、
<br>天井に取り付け最大8mのエアーホースを自由に引き出し可能。

<br><br>エアーを使いたい時に、使いたい長さまで引っ張れば
<br>ホースが出てきて固定されます。
<br>※こちらの商品は８ｍタイプですが、 　輸入品の為、長さには多少誤差がございます。 　７．５ｍ～８ｍの長さとなりますので、予めご了承下さい。
<br>※壁面に取り付ける際のネジは付属しておりませんのでお手数をおかけ致しますが、お客様の方でご用意下さい。<br><br>
本体サイズ：直径 23cm × 厚さ 7cm (突起含まず)
<br>ホースの長さ：約７．５ｍ～８m
<br>ホースの外径：8mm
<br>ホースの内径：5mm
<br>材質：ポリウレタン樹脂
<br>(接続ホースはウレタン1/4)

<br><br>※天吊り
