サイズ調整可能　10本セット！！<br><br>


●サイズ調節可能な本体は タイヤ幅145～285mmまでの 様々な車種に対応可能<br> 

●使い方は、とても簡単です「巻いて、締めるだけ」 
<br>
●2本の突起が、接地圧力を高め、強力なグリップ力を発生させる<br> 
●本体は走行中にズレないよう、裏面中央にタイヤ溝に はめ込むための突起を設置<br> 

<br> <br> <br> 
●サイズ本体 全長：約108ｃｍ<br> 
●カラー：イエロー <br> 
●材質：TPU、スチール（突起部等）<br> 
●重量（1セット）：2.2kg <br> 
●適応タイヤ幅：145mm～285mmまで <br> 
●気温：マイナス40度まで対応可 <br> 
●内容物：本体10本（駆動タイヤ2本用）<br> 
